description:
Otages (Maurizio Merli, Colmax / Classic 1994)

Two young, perverse, armed hooligans break into the residence of a middle-class family. With the head of household bound and rendered helpless, the two women of the house are at the mercy of the scrupleless ruffians! Watch as the ladies are made to endure every whim of their captors!

Feature, Classic

